data.addColumn('string', 'Date and Reporting Period');
data.addColumn('number', 'Net Asset - Net Asset (S$000)');
data.addColumn('number', 'Debt - (S$000)');
data.addRows([['2015',813488,341848],
['2016',1073868,439321],
['2017',1116502,546481],
['2018',1389738,678709],
]);
var options = {
    title: 'Historical Net Asset & Debt - Keppel DC Reit (AJBU.SI)',
    width: 900,
    height: 500,
    legend: { position: 'bottom' },
    chartArea:{left:'10%',top:'10%',width:'85%',height:'75%'},
    hAxis: {
        format: 'MMM-d',
        gridlines: {count: 10}
    },
    
    vAxis: { gridlines: {count: 10} },
    backgroundColor: {
        strokeWidth:3,
        stroke: '#666'
    }
};
var chart = new google.visualization.ColumnChart(document.getElementById('NaAndDebt'));
chart.draw(data, options);
}
